import axios from "axios";

const Url = "http://192.168.1.10/api_react";

function getUsers() {
  const response = axios.get(Url+"/getUser.php");

  return response;
}

function deleteUsers({id}) {
  const response = axios.get(Url+"/eleteUser.php?id="+id);

  return response;
}

export { getUsers,deleteUsers };
